INSERT INTO `faq_unbk` (`faq_id`, `isi_pertanyaan`, `jawaban`, `pembuat_faq`, `tanggal_dibuat`, `status_tampil`) VALUES
(1, 'Nomor UN yang dipakai kok beda ?', '<p>\n                                                Nomor UN yang dimiliki siswa sampai dengan Ujian Nasional adalah sepanjang 9 digit. Namun setelah menerima hasil Ujian Nasional, nomornya akan menjadi 14 digit. Adapun format lengkap 14 nomor UN adalah sebagai berikut :</p>\n                                            <p>\n                                                JTTPPKKSSSNNNC</p>\n                                            <p>\n                                                J = Jenjang asal sekolah : SD/MI=1, SMP/MTs=2, SMA/MA=3, SMK=4, Kejar Paket A = A, &nbsp;Kejar Paket B = B</p>\n                                            <p>\n                                                TT = Tahun lulus : Lulus tahun ini=14</p>\n                                            <p>\n                                                PP = Kode Provinsi : Jawa Timur=05</p>\n                                            <p>\n                                                KK = Kode Kabupaten/Kota : Surabaya=01 atau 51</p>\n                                            <p>\n                                                SSS = Kode Sekolah</p>\n                                            <p>\n                                                NNN = Nomor urut</p>\n                                            <p>\n                                                C = Cek</p>\n                                            <p>\n                                                Dalam kegiatan PPDB ini digunakan nomor UN yang panjangnya 14 digit. Jadi, nomor yang dimiliki sampai pelaksanaan ujian adalah KKSSSNNNC, tinggal menambahkan JTTPP di depannya.</p>\n                                            <p>\n                                                Contoh :</p>\n                                            <ul 15px;"="">\n                                                    <li>\n                                                            Lulus SD/MI sekarang, ditambahkan&nbsp; 11405</li>\n                                                    <li>\n                                                            Lulus SMP/MTs sekarang, ditambahkan&nbsp; 21405</li>\n                                                    <li>\n                                                            Lulus SMA/MA sekarang, ditambahkan&nbsp; 31405</li>\n                                                    <li>\n                                                            Lulus SMK sekarang, ditambahkan&nbsp; 41405</li><li>Lulus kejar paket A sekarang, ditambahkan A1405</li><li>Lulus kejar paket B sekarang, ditambahkan B1405</li>\n                                            </ul>', 'najib', '2013-05-30 09:45:57', 0),
(3, 'Pagu 1% itu menghitungnya bagaimana?', '<div><ul><li><span  1.42857143;">Pagu 1% adalah alokasi kapasitas penerimaan bagi calon peserta didik yang bukan warga Surabaya, baik yang sekolah asalnya di luar kota Surabaya maupun yang sekolah asalnya di Surabaya.&nbsp;</span><br></li><li><span  1.42857143;">Pagu 1% dihitung terhadap pagu kota maupun pagu sekolah</span><br></li><li><span  1.42857143;">Pagu 1% untuk pagu sekolah dihitung dari pagu awal (tidak dipengaruhi oleh besarnya pagu bagi mitra warga, prestasi, inklusif dan yang tidak naik)</span><br></li><li><span  1.42857143;">Nilai yang digunakan dalam perankingan adalah Nilai NUS(untuk SMP) / NUN (untuk SMA)</span><br></li><li><span  1.42857143;">Perkecualian diberikan bagi calon peserta didik yang berasal dari sekolah di Wilayah Kota Surabaya dan bukan warga Surabaya yang orang tuanya dipindahtugaskan karena perintah jabatan di Surabaya meliputi Anggota Tentara Nasional Indonesia (TNI), Anggota Kepolisian Republik Indonesia (POLRI), Pegawai Negeri Sipil (PNS) Pemerintah Pusat, Karyawan Badan Usaha Milik Negara (BUMN) dengan dilampirkan Surat Keputusan Pindah Tugas atau dokumen lain yang sejenis, serta memiliki surat keterangan domisili di wilayah Kota Surabaya yang dikeluarkan oleh Kecamatan maksimal setelah 6 (enam) bulan penempatannya di Surabaya</span><br></li></ul></div><div>Keterangan lebih detail dapat dilihat di : ppdbsurabaya.net/umum/pagu</div><div><br></div>', 'admin', '2014-06-23 19:25:52', 0),
(4, 'Apakah diperbolehkan mendaftar pada jalur kawasan dan jalur umum?', '<div><ul><li><span  1.42857143;">Hanya bagi yang sudah mendaftar melalui jalur sekolah kawasan namun tidak diterima, yang diperbolehkan mendaftar melalui jalur umum.</span><br></li><li><span  1.42857143;">Pendaftaran Jalur Kawasan dilakukan secara online pada tanggal 26 Juni 2014 pk. 00.00 sampai dengan 28 Juni 2014 pk. 23.59</span><br></li><li><span  1.42857143;">Pendaftaran Jalur Umum dilakukan secara online pada tanggal 3 Juli 2014 pk. 00.00 s.d. 6 Juli 2014 pk. 23.59</span><br></li></ul></div><div><br></div>', 'admin', '2014-06-23 19:26:59', 0),
(5, 'Bagaimana jika data yang saya masukkan pada versi latihan salah?<br>', 'Semua data yang dimasukkan pada masa / versi latihan hanya bersifat sementara, tidak digunakan dalam proses pendaftaran online.<br>', 'admin', '2014-06-23 19:30:02', 0),
(6, 'Apakah ada jalur pendaftaran yang tidak online?<br>', '<div>Proses pendaftaran calon peserta didik SMP, SMA dan SMK di wilayah Kota Surabaya dilakukan oleh calon peserta didik secara online melalui situs ppdbsurabaya.net</div><div>Proses pendaftaran calon peserta didik SD di wilayah Kota Surabaya dilakukan oleh sekolah, namun informasinya dapat diakses oleh masyarakat melalui situs ppdbsurabaya.net</div><div><br></div><div>Dikecualikan dalam proses pendaftaran ini adalah:&nbsp;</div><div><ul><li><span  1.42857143;">Pendaftaran di Sekolah yang dituju untuk Jalur Mitra Warga, Jalur Inklusif, Jalur Satu Lokasi</span><br></li><li><span  1.42857143;">Pendaftaran di Dinas Pendidikan untuk Jalur Prestasi Olahraga, Jalur Prestasi Akademik, Serta Jalur Prestasi Non Akademik</span><br></li></ul></div><div><br></div>', 'admin', '2014-06-23 19:31:13', 0),
(7, 'Bagaimana jika ada masalah pada server, apakah bisa menggunakan server lain?', 'Bisa copy Paste VHD dari server utama ke server cadangan kemudian hubungi POSKO untuk Unlock.', 'Tri Widodo ', '2016-03-07 09:45:58', 1),
(8, 'Apakah bisa ditambahkan fitur untuk melihat nilai hasil ujian siswa?', 'Untuk nilai secara system bisa ditampilkan, tetapi secara regulasi tidak diperkenankan', 'Mufi', '2016-03-07 09:45:59', 1),
(9, 'Bagaimana status siswa yang berpindah server, apakah lanjut atau mengulang?', 'Soal yang digunakan untuk simulasi adalah soal dummy yang berbeda dengan kisi-kisi UN. SImulasi hanya digun akan untuk menguji dan trial Sistem bukan materi ujian', 'Mufi', '0000-00-00 00:00:00', 1),
(10, 'Bagaimana mengatasi permasalahan tanggal di server yang maju satu hari?', ' jika muncul lisensi <i>error<i>, buka petunjuknya di web UNBK Lisensi <i>error <i>', 'Andi', '0000-00-00 00:00:00', 1),
(11, 'Apakah jadwal gladi harus sesuai yg ada di web? Karena ada libur paskah Untuk sekolah-sekolah Katholik?', 'Tetap mengikuti Jadwal tgl 21-23, setelah itu bisa menyesuaikan/libur Paskah', 'Ekowati', '0000-00-00 00:00:00', 1),
(12, 'Data di server cadangan merupakan data pecahan dari data seluruh siswa', 'Antivirus untuk dimatikan sementara pada saat UNBK berlangsung', 'Luluk', '0000-00-00 00:00:00', 1),
(13, 'Proses mengaktifkan security seperti antivirus, firewall cukup merepotkan?', 'Format Date &Time Location dirubah ke English (United States) jika masih menggunakan Format Indonesia', 'Luluk', '0000-00-00 00:00:00', 1),
(14, 'Pihak proktor yang menandatangani Pakta Integritas?', 'Format laporan untuk Proktor disesuikan dengan Excel kemudian di tanda tangani dan diupload di server UNBK', 'Luluk', '0000-00-00 00:00:00', 1),
(15, 'Soal gaji proktor dan teknisi bagaimana?', 'Untuk Penggajian UNP sudah diserahkan ke pihak Dinas Pendidikan Provinsi Jawa Timur', 'Luluk', '0000-00-00 00:00:00', 1),
(16, 'Server cadangan mengenai fungsi dan posisi, teknisnya dan posisi, posisi yang benar dimana?kalau terjadi kesalahan server akan ditaruh dimana?', 'Server cadangan seperti ban serep. Dipakai kalau memang benar2 server pertama tidak bisa dipakai. contoh: hardisk terbakar. Tolong diselamatkan data siswanya di .vhd -> copy file .vhd dipindah ke server cadangan. <b>Server cadangan tidak mewajibkan ruang cadangan</b>. Client cadangan ditaruh di dekat server cadangan. Computer client <i>heng</i> melanjutkan test ketika siswa lain sudah selesai mengerjakan dan mengerjakan ulang. Wajib mensinkronisasi server cadangan', 'Anggi', '0000-00-00 00:00:00', 1),
(17, 'Sistem Operasi rekomendasi yang direkomendasikan untuk UNBK? Dalam satu ruangan menggunakan beberapa OS apakah boleh? Dampaknya apa?', 'Tidak merekomendasikan OS apapun, khusus: LINUX ver 14.04. Untuk OS Windows 10 (client) kalau ada masalah tiap 5 menit logout, cara mengatasi yaitu date and time, settingan lokasinya diubah ke English (UK) atau English (US). Karena selalu ke Indonesia, <b>contoh: 16.16. exambro pake framework 2.0, sedangkan di 8.0 keatas frameworknya 3.5 keatas. Saran jangan windows XP</b>', 'Anggi', '0000-00-00 00:00:00', 1),
(18, 'Untuk server 1 pc menggunakan 2 sekolah. Sudah sinkron semua. Semua sudah mengikuti prosesdur.Ada sebab lain yang menyebabkan status offline?', 'Biasanya, kejadiannya di server cadangan. Di simulasi 3 ada menu data sekolah ada data server dan client. <b>Tolong didaftarkan. Tolong daftarkan server cadangan di menu server cadangan; server utama di menu server utama.</b>', 'Lutfi', '0000-00-00 00:00:00', 1),
(19, 'Jawabannya ada yang tidak diisi (x), apa sebabnya??', 'Artinya siswa tidak menjawab, maka notasinya akan menjadi kosong (X). bagaimana jika hari kedua ada X satu. Biasanya di soal terakhir melihat soal sebelumnya untuk di cek ulang. Solusinya ada di file patching yang nanti akan di lauching?', '', '0000-00-00 00:00:00', 1),
(20, 'Simulasi ketiga menggunakan dua ruangan, menggunkan 2 ip yang berbeda. Ipnya tiba-tiba berubah? Cara mengatasi nya gimana?', 'IP harus di set static, maksudnya jangan DHCP bukan dynamic. Kalau di DHCP dapetnya bukan 192.168.x.x, tatapi 169.x.x.x. jadi soulusinya menggunakan IP static', 'smp negeri 23', '0000-00-00 00:00:00', 1),
(21, 'Saat simulasi 2 tidak berhasil, ketika status offline yang muncul adalah symbol-simbol. Solusinya belum terselesaikan, katanya dari pusat. Masalah sebenarnya apa?', 'Status muncul symbol, tolong di setting language nya di setting <i>English</i> atau bahasa Indoensia, di dalam server.', 'MTS amanathul ummah', '0000-00-00 00:00:00', 1),
(22, 'Simulasi kedua ketika masuk awal kurang lebih 20 menit. Bagaimana penanganannya?', 'Matematika SMP ada 2 paket yang waktunya tidak normal, tolong untuk disinkronisasi ulang.', 'Mts ITTAQU', '0000-00-00 00:00:00', 1),
(23, 'Kategori pengawas seperti apa? 1 proktor 1 ruangan?', 'Pengawas seperti PBT, proktor tidak disilang (sesuai sekolah masing-masing).', 'Smpn 45', '0000-00-00 00:00:00', 1),
(24, 'Solusi ketika membuka .vhd ketika lampu mati, server mati. Ketika ingin mencoba lagi bit looker hilang. Solusi??', 'Password bit looker : P4ssw0rd', 'Smpn 45', '0000-00-00 00:00:00', 1),
(25, 'Kejanggalan ketika di simulasi 2, tokennya lama tidak bisa diakses. Token sudah, soalnya tidak jelas (soal IPA). Tidak bisa login, (tempat dan lokasi berbeda tapi tetap tidak bisa). Siswa login terjadi maintenance. Apakah masih sering terjadin maintenance dadakan ketika mengadakan simulasi terakhir?', 'Karena pada saat simulasi kedua banyak yg sinkron (bersamaan), seharunya simulasi dan sinkron tidak diwaktu yang sama. Pada saat gladi resik, server pusat akan terfokus pada rilis token.Untuk gambar yang tidak jelas sudah direvisi. Untuk tidak bisa login, tolong di cek informasi kesalahannya. Kalau memang password salah tolong diinfokan ke koordinator. Kalau error tidak valid berarti tidak ada datanya. Masalah maintenance selalu dijadwalkan malam (22.00-01.00).', 'Smpn 27', '0000-00-00 00:00:00', 1),
(26, 'Laporan yang dalam bentuk pdf xls dll, tiap sesi ada laporan. Ketika membuat laporan di sesi kedua dst tidak sama ( sesi 1=4 halaman; sesi 2=7halaman). Tombol upload tidak sesuai jumlah per sesi. Laporan sekolah tanggalnya tidak cocok (laporan 20 feb, real 19 feb)?', 'Laporan memang betul setiap sesi 1 sesuai sesi 1, sesi 2 gabungan dari sesi 1 dan 2. Jangan langsung cetak tetapi pindahkan ke excel. Kemudian di edit (dipotong antara sesi 1 dan 2).Upload hanya ada 5 tempat, kerena tidak tau kebutuhan tiap sekolah. Solusinya di edit lewat<i>photoshop</i> atau <i>paint brush</i>.', 'Smpn 27', '0000-00-00 00:00:00', 1),
(27, 'Untuk pengaturan siswa, yang mengatur apakah sekolah atau pusat? Karena mengacu pada client yang akan diset. Mohon petunjuk dari pusat. Untuk jenis kelamin siswa, untuk pelaksanaan UNBK seperti apa?', 'Misal kejadian mati lampu di sesi ketiga sampai sore. Tolong laporan ke puspendik untuk tidak menutup sesi tersebut. <br><p>Case: Sesi 4 tidak bisa masuk karena passwordnya dipakai temannya, server utama dan server cadangan; sebisa mungkin menggunakan server utama, selama file .vhd bisa diselamatkan tolong untuk dimasukkan di mesin lain</p>. Laporan disarankan menggunkan menu <b><i>export</i></b>. Ada lambang  <b><i>floppy disk </i></b> itu adalah fitur export. Disarankan <b><i>export</i></b> ke excel atau .xls. Ada rencana yang di web menerima file upload excel bukan image.', 'Smpn 2', '0000-00-00 00:00:00', 1),
(28, 'Pada waktu unbk ada trouble di server 30 menit lebih, apakah ada unbk ulang? Atau mengikuti sesi berikutnya? ', 'Kebijakan sekolah masing-masing', 'Smp khadijah 2', '0000-00-00 00:00:00', 1);
